INSERT INTO public.todos (created_at,id,is_complete,title,user_id) VALUES (DEFAULT, 'a064272e-ff8c-5df9-8bc1-7b8d73cc3537', DEFAULT, 'Chi kayo yokitame kechi nohyki tano, shinavi make vayovi mu kai kinvichi vachihyta ko.', NULL), (DEFAULT, '513dbb4c-8301-58d0-a572-04187987bb03', DEFAULT, 'Vimumi kai hy kaima hani hanovayo, niyoa ha sohano mokairamo meso nokia raekikai mi.', NULL), (DEFAULT, 'b97fca52-98ed-5450-ad1b-cc0fb176533d', DEFAULT, 'Ranisokai me koceavi vanimokin takikamo momakekin raso.', NULL), (DEFAULT, 'd2448ca0-6f45-571f-a4a2-c80829922b74', DEFAULT, 'Kiyoka kinra yoceayuta nomeso ke, yu chihykihy shino hamiceayu tachia kominamu rae sokaiachi.', NULL), (DEFAULT, 'b512dd1b-77a0-5693-b80e-1406cdc44ff3', DEFAULT, 'Koke no mahy so mukeva michicea someko havi, raeyoyu viame ha hashimushi hakomami rae vayu ra.', NULL), (DEFAULT, '7fd510e7-41ac-5730-b098-47664db0514e', DEFAULT, 'Nova kenomino kaiyova monaso vamechika.', NULL), (DEFAULT, '0a3be68d-6f0d-5634-aa28-91d5984723c2', DEFAULT, 'Kihavicea mira shihashita vitachi mi kinmea, hymo yo novi vakinkiha hyso ki.', NULL), (DEFAULT, 'eefaf3f2-260c-52fe-85b7-6327152a0ea3', DEFAULT, 'Hanoshihy ko hykai soni kaimoni kota.', NULL), (DEFAULT, 'e8c428fa-755f-57f3-92f1-b04c1f8cf80f', DEFAULT, 'Na sovanicea hytachi yoshiceani va nako vikami, mu kakihako chirae hya nonaceaki via raekaiyua.', NULL), (DEFAULT, '1ccea6ff-b1c7-52a3-b033-173ad5a8d5ae', DEFAULT, 'Mira chiyo ceamushiso vahyta ki kohy ka shi, ki vame ka havihy ra ceayu va.', NULL), (DEFAULT, '0c805182-22e6-5134-92fe-aaf40e85b4fa', DEFAULT, 'Yocea kai mamorae nayo mi, kaivakishi meha no kihyshi vishichi raeyuhami kira.', NULL), (DEFAULT, '99b3cd0a-4033-592e-ba94-6f0709d9e5a5', DEFAULT, 'Kinsoke chirayora so rashihake mehyrae mameni, vakiko shinohy mi ceachina kenishimu yoa kota.', NULL), (DEFAULT, 'f58842cd-4345-59bc-b98f-cd1c8ed98023', DEFAULT, 'Chikaita hyta chikai shi ceakinkike, nimu so mevimo viyuhykai chimo.', NULL), (DEFAULT, '7cfea23d-5659-583e-86e6-db69e3f0b9c6', DEFAULT, 'Miso ceachiyu chinohy ta monake ni.', NULL), (DEFAULT, '8edf4f43-6b66-5990-b8f2-6e6a8e8bffef', DEFAULT, 'Kinmi soni kaivamita ha vamimu.', NULL), (DEFAULT, 'f9efd0ff-1c10-5adf-9a3e-e729c3115747', DEFAULT, 'No yuchiyu sovashimo ra maniva mihanoma.', NULL), (DEFAULT, '1358e3fa-bad5-5982-8bae-ca110822e011', DEFAULT, 'Metashiva ka sokaiha ramemamo ka, raehy kirani ki ceake shi mume.', NULL), (DEFAULT, '57aed4d5-a339-5cc7-8fe6-86e5cfa7f5b5', DEFAULT, 'Kakometa koni vakishi mi hymoshi hyshichiko.', NULL), (DEFAULT, '42e4745b-0471-5545-b9a7-f82bf9b5c2df', DEFAULT, 'Vihaso ka namikaimo kaikakinso kotaso soka.', NULL), (DEFAULT, '6ec273f7-9b32-5a74-a156-495046cf4992', DEFAULT, 'Kevimo cea mina vameko hy rashiyo namiva.', NULL);
